import React, { useState, useEffect } from "react";
import Typed from "react-typed";
import "./Home.css";

const Home = () => {
  let texts = ["Zakaria Dani", "a Software Engineer", "a Web Developer"];
  return (
    <div id="home">
      <h3>Hello, I am <Typed
            strings={texts}
            typeSpeed={40}
            backSpeed={50}
            loop
          /></h3>
        
          <p>passionate about creating interactive applications and experiences on the web.</p>
          <div id="socialMedia">
            <button id="resume">Resume</button>
            <button id="linkedin"><ion-icon name="logo-linkedin"></ion-icon></button>
            <button id="gitHub">gitHub</button>
          </div>
    </div>
  );
};

export default Home;
